import { combineReducers } from "redux";
import { connectRouter } from 'connected-react-router';
import newsItemPage from "reducers/newsItemPage.js"
import newsPage from "reducers/dataPage.js";
import swiper from "reducers/swiper.js";
import news from "reducers/data.js";

export default history => combineReducers({
    news,
    newsPage,
    swiper,
    newsItemPage,
    router: connectRouter(history)
})